        require(msg.sender == address(this));
        return 1;
    }

    function test_expectRevert_1() external returns (uint256) {
        vm.expectRevert();  // expected to fail
        try this.notReverting() returns (uint256 r) {
            return 1;
        } catch {
            assert(false); //should get here
        }
    }

