        require(msg.sender == address(this));
        vm.expectRevert();  // expected to fail
        return 1;
    }

    function test_expectRevert_2() external returns (uint256) {
        try this.missingCall() returns (uint256 r) {
            return 1;
        } catch {
            assert(false); //should get here
